/// Query defines the gRPC querier service.
///
/// To build a server, implement a class that conforms to this protocol.
internal protocol Stratos_Evm_V1_QueryProvider: CallHandlerProvider {
  var interceptors: Stratos_Evm_V1_QueryServerInterceptorFactoryProtocol? { get }

  /// Account queries an Ethereum account.
  func account(request: Stratos_Evm_V1_QueryAccountRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryAccountResponse>

  /// CosmosAccount queries an Ethereum account's Cosmos Address.
  func cosmosAccount(request: Stratos_Evm_V1_QueryCosmosAccountRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryCosmosAccountResponse>

  /// ValidatorAccount queries an Ethereum account's from a validator consensus
  /// Address.
  func validatorAccount(request: Stratos_Evm_V1_QueryValidatorAccountRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryValidatorAccountResponse>

  /// Balance queries the balance of a the EVM denomination for a single
  /// EthAccount.
  func balance(request: Stratos_Evm_V1_QueryBalanceRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryBalanceResponse>

  /// Storage queries the balance of all coins for a single account.
  func storage(request: Stratos_Evm_V1_QueryStorageRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryStorageResponse>

  /// Code queries the balance of all coins for a single account.
  func code(request: Stratos_Evm_V1_QueryCodeRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryCodeResponse>

  /// Params queries the parameters of x/evm module.
  func params(request: Stratos_Evm_V1_QueryParamsRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryParamsResponse>

  /// EthCall implements the `eth_call` rpc api
  func ethCall(request: Stratos_Evm_V1_EthCallRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_MsgEthereumTxResponse>

  /// EstimateGas implements the `eth_estimateGas` rpc api
  func estimateGas(request: Stratos_Evm_V1_EthCallRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_EstimateGasResponse>

  /// TraceTx implements the `debug_traceTransaction` rpc api
  func traceTx(request: Stratos_Evm_V1_QueryTraceTxRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryTraceTxResponse>

  /// TraceBlock implements the `debug_traceBlockByNumber` and `debug_traceBlockByHash` rpc api
  func traceBlock(request: Stratos_Evm_V1_QueryTraceBlockRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryTraceBlockResponse>

  /// BaseFee queries the base fee of the parent block of the current block,
  /// it's similar to feemarket module's method, but also checks london hardfork status.
  func baseFee(request: Stratos_Evm_V1_QueryBaseFeeRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryBaseFeeResponse>

  /// BaseFeeParam queries the base fee of the parent block of the current block.
  func baseFeeParam(request: Stratos_Evm_V1_QueryBaseFeeRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryBaseFeeResponse>

  /// BlockGas queries the gas used at a given block height
  func blockGas(request: Stratos_Evm_V1_QueryBlockGasRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryBlockGasResponse>

  func addressConvert(request: Stratos_Evm_V1_QueryAddressConvertRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Stratos_Evm_V1_QueryAddressConvertResponse>
}

