/// Query defines the gRPC querier service.
///
/// To implement a server, implement an object which conforms to this protocol.
@available(macOS 10.15, iOS 13, tvOS 13, watchOS 6, *)
internal protocol Stratos_Evm_V1_QueryAsyncProvider: CallHandlerProvider {
  static var serviceDescriptor: GRPCServiceDescriptor { get }
  var interceptors: Stratos_Evm_V1_QueryServerInterceptorFactoryProtocol? { get }

  /// Account queries an Ethereum account.
  @Sendable func account(
    request: Stratos_Evm_V1_QueryAccountRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryAccountResponse

  /// CosmosAccount queries an Ethereum account's Cosmos Address.
  @Sendable func cosmosAccount(
    request: Stratos_Evm_V1_QueryCosmosAccountRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryCosmosAccountResponse

  /// ValidatorAccount queries an Ethereum account's from a validator consensus
  /// Address.
  @Sendable func validatorAccount(
    request: Stratos_Evm_V1_QueryValidatorAccountRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryValidatorAccountResponse

  /// Balance queries the balance of a the EVM denomination for a single
  /// EthAccount.
  @Sendable func balance(
    request: Stratos_Evm_V1_QueryBalanceRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryBalanceResponse

  /// Storage queries the balance of all coins for a single account.
  @Sendable func storage(
    request: Stratos_Evm_V1_QueryStorageRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryStorageResponse

  /// Code queries the balance of all coins for a single account.
  @Sendable func code(
    request: Stratos_Evm_V1_QueryCodeRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryCodeResponse

  /// Params queries the parameters of x/evm module.
  @Sendable func params(
    request: Stratos_Evm_V1_QueryParamsRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryParamsResponse

  /// EthCall implements the `eth_call` rpc api
  @Sendable func ethCall(
    request: Stratos_Evm_V1_EthCallRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_MsgEthereumTxResponse

  /// EstimateGas implements the `eth_estimateGas` rpc api
  @Sendable func estimateGas(
    request: Stratos_Evm_V1_EthCallRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_EstimateGasResponse

  /// TraceTx implements the `debug_traceTransaction` rpc api
  @Sendable func traceTx(
    request: Stratos_Evm_V1_QueryTraceTxRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryTraceTxResponse

  /// TraceBlock implements the `debug_traceBlockByNumber` and `debug_traceBlockByHash` rpc api
  @Sendable func traceBlock(
    request: Stratos_Evm_V1_QueryTraceBlockRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryTraceBlockResponse

  /// BaseFee queries the base fee of the parent block of the current block,
  /// it's similar to feemarket module's method, but also checks london hardfork status.
  @Sendable func baseFee(
    request: Stratos_Evm_V1_QueryBaseFeeRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryBaseFeeResponse

  /// BaseFeeParam queries the base fee of the parent block of the current block.
  @Sendable func baseFeeParam(
    request: Stratos_Evm_V1_QueryBaseFeeRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryBaseFeeResponse

  /// BlockGas queries the gas used at a given block height
  @Sendable func blockGas(
    request: Stratos_Evm_V1_QueryBlockGasRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryBlockGasResponse

  @Sendable func addressConvert(
    request: Stratos_Evm_V1_QueryAddressConvertRequest,
    context: GRPCAsyncServerCallContext
  ) async throws -> Stratos_Evm_V1_QueryAddressConvertResponse
}

